import React from 'react'

import contact_image from '../../image/contact.png'
import for_artists_image from '../../image/for-artists.png'
import for_brands_image from '../../image/for-brands.png'

import './contact.css'


const delay_gap = 300;

const Contact = () => {

  function mouseOver(event) {
    let element = document.getElementById(event.target.id);
    element.style.transform = 'scale(1.20)';
  }
  
  function mouseLeave(event) {
    let element = document.getElementById(event.target.id);
    element.style.transform = 'scale(1.0)';
  }

  return (
    <div className='contact'>
      <div className='contactImageContainer'>
        <img src={contact_image} alt='' className='contactImage' id='contactImage'/>
        <img data-aos="fade-up" data-aos-delay="1200" data-aos-offset="1000" src={for_artists_image} alt='' className='contactImage' id='artistsImage'/>
        <img data-aos="fade-up-left" data-aos-delay="1400" data-aos-offset="1000" src={for_brands_image} alt='' className='contactImage' id='brandImage'/>
      </div>
    </div>
  )
}

export default Contact
